import * as React from 'react';
import { useState, useEffect } from 'react';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import { Button } from '@mui/material';
import TextField from '@mui/material/TextField';
import { Link, useLocation } from 'react-router-dom';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import DeleteIcon from '@mui/icons-material/Delete';
import AddCircleIcon from '@mui/icons-material/AddCircle';
import EditIcon from '@mui/icons-material/Edit';
import { Tooltip } from '@mui/material';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import { styled, Box } from '@mui/system';
import ModalUnstyled from '@mui/base/ModalUnstyled';
import { Stack } from '@mui/material';
import { Select, MenuItem } from '@mui/material';
import axios from 'axios';
import { variables } from '../Variables';

const relationshipTypes = [
        {
                id: 1,
                relationshipType: 'Child'
        },
        {
                id: 2,
                relationshipType: 'Spouse'
        },
        {
                id: 3,
                relationshipType: 'Domestic Partner'
        },
]






const Employee = (props) => {
        const {state} = useLocation();
        const [open, setOpen] = useState(false);
        const [employeeFirstName, updateFirstName] = useState(state.firstName);
        const [employeeLastName, updateLastName] = useState(state.lastName);








        const EditEmployee = async (employee) => {
                if (employee == null) {
                        return;
                }

                await axios.put(`${variables.API_URL}/Employee/${employee.id}`, {
                        id: state.id,
                        firstName: employeeFirstName,
                        lastName: employeeLastName,
                        compensationType: state.compensationType
                })
                        .then(res => console.log(res));
        }


        return (
                <div>
                        <Box component="form"
                                sx={{
                                        '& .MuiTextField-root': { m: 1, width: '25ch' },
                                        'flowGrow': 1
                                }}>
                                <Grid container spacing={2}>
                                        <Grid item xs={12} sx={{ display: 'flex' }}>
                                                <div>
                                                        <Link to="/employees"><Button startIcon={<ArrowBackIcon />} size="large">Go Back</Button></Link>
                                                </div>

                                        </Grid>
                                        <Grid item xs={6}>
                                                <Grid item xs={12}>
                                                        <h1>Edit Employee</h1>
                                                        <TextField
                                                                required
                                                                id="outlined-required"
                                                                label="First Name"
                                                                defaultValue={state.firstName}
                                                                onChange={e => updateFirstName(e.target.value)}
                                                        />
                                                        <TextField
                                                                required
                                                                id="outlined-required"
                                                                label="Last Name"
                                                                defaultValue={state.lastName}
                                                                onChange={e => updateLastName(e.target.value)}
                                                        />
                                                </Grid>
                                                <Grid item xs={12}>
                                                        <Button variant="contained" color="success" size='large' onClick={e => EditEmployee(state)}>Update</Button>
                                                </Grid>
                                        </Grid>
                                        <Grid item xs={6}>
                                                
                                        </Grid>
                                </Grid>
                        </Box>
                </div>
        );
}

export default Employee
